import { motion } from "framer-motion"
import React from "react"

const HeaderMenu = ({ children }) => {
    return (
        <div
            style={{
                // backgroundColor: 'red',
                margin: '22px 0px'
            }}
        >
            {children}
        </div>
    )
}

const Item = ({ children }) => {
    return (
        <motion.span>
            {children}
        </motion.span>
    )
    return React.cloneElement(children, {
        fontSize: 22,
        style: {
            // backgroundColor: 'blue',
            margin: 8,
            cursor: 'pointer'
        }
    })
}

export {
    Item
}

export default HeaderMenu
